function putvideo(stsurl,filename,file,callback){$.get(stsurl,function(response){console.log(response);let=stskey=response.sts;try{let=client=new OSS(stskey);client.multipartUpload("video/"+filename,file).then(function(res){callback(true);});}catch(e){errmsg="parse sts response info error: "+e.message;callback(errmsg);}});}
function putimage(stsurl,filename,file,callback){$.get(stsurl,function(response){console.log(response);let;stskey=response.sts;try{let;client=new OSS(stskey);client.multipartUpload("image/"+filename,file).then(function(res){callback(res);});}catch(e){errmsg=e.message;callback(errmsg);}});}
